import React from 'react';

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to Our Hair Salon</h1>
      <p>We provide top-notch hair, nail, and hair removal services tailored to your needs.</p>
      <button onClick={() => window.location.href = '/services'}>View Our Services</button>
    </div>
  );
};

export default HomePage;
